@hyzerflipdesigns outdid himself with our new pieces! 

@cmonty35876 birthday is next month and I wanted to do something special. I reached out to @hyzerflipdesigns after seeing @sockibomb13 custom piece inquiring about one for Colt of his signature logo. In the process I decided I wanted our wedding logo that my dad and brother created for us. We call it the castle Monty logo(: 

The turn around time was incredibly fast and we love how they came out. Thanks again Mike!!!

Charity Ice Bowl at Prado! 

@cmonty35876 and I are so stoked to join in on the fun today. I donated one of my @dynamicdiscs Mission Rig signature bags and Colten donated some discs as well. Mulligans are so fun😂 

Health Update: I am getting an appt with a thyroid surgeon. Going to chat with them about what’s next. Depending on the answers I receive, Hot KoCo might be heading back out on the road soon. We shall see!

